import { Card, Delimiter, Helpers, PageMain, SimpleGrid } from "core";
import React, { Component } from "react";
import logo from "../../../src/assets/pic/Bank_Sepah_logo.svg.png";
import constants from "../../utils/constants";
import { HandleError } from "../../utils/generals";

//import sepahBank from "../../../public/manifest.json";

export class RealCustomerInformationSection extends Component {
  constructor(props) {
    super(props);
    // this.personNumberTypeId =
    //   this.props.match.params.personNumberTypeId ==
    //   constants.PersonNumberType.Real
    //     ? null
    //     : constants.PersonNumberType.Legal;
    // this.id = this.props.match.params.id;

    // this.personNumberTypeId = this.props.match.params.personNumberTypeId;

    this.state = {
      // extraData: {
      //   extraData: this.personNumberTypeId,
      // },
    };
    this.pageInfo = {
      title: "اطلاعات مشتریان حقیقیCIF",
      icon: "",
    };

    this.notificationSystem = React.createRef();
  }

  // componentDidMount() {
  // Helpers.CallServer(
  // "/api/FINSP/Verdict/GetForPrint",
  // {
  // id: this.verdictId,
  // },
  // (successfulResponse) => {
  // this.setState({
  // inspectorName: successfulResponse.inspector,
  // inspectorsName: successfulResponse.inspectors,
  // unit: successfulResponse.unit,
  // signatureOne:
  // "data:image/jpeg;base64," + successfulResponse.signatureOne,
  // signatureTwo:
  // "data:image/jpeg;base64," + successfulResponse.signatureTwo,
  // units: successfulResponse.units,
  // });
  // },
  // (errorResponse) =>
  // HandleError(Helpers, this.notificationSystem, errorResponse),
  // () => {}
  // );
  // }
  //   myFunction(value, index, array) {
  //     return (txt += " " + value);
  //   }
  //   componentDidMount = () => {
  //     Helpers.CallServer(
  //       "/api/eld/lawsuitsDossier/getlawsuitsDossierAction",
  //       {
  //         id: this.id,
  //         codeChallenge: Helpers.GenerateRandomString(16),
  //       },
  //       (res) => {
  //         let userNameTitle = res.userNameTitle;

  //         this.setState({
  //           generatedCode: res.generatedCode,
  //           plaintiff: res.plaintiff,
  //           complainted: res.complainted,
  //           litigantTitle: res.litigantTitle,
  //           dossierFilingPersianDate: res.dossierFilingPersianDate,
  //           complaintSettingDate: res.complaintSettingDate,
  //           dossierClosingPersianDate: res.dossierClosingPersianDate,
  //           dossierTypeTitle: res.dossierTypeTitle,
  //           description: res.description,
  //           financialOrNonfinancialTitle: res.financialOrNonfinancialTitle,
  //           lawsuitStatusTitle: res.lawsuitStatusTitle,
  //           topicsTypeTitle: res.topicsTypeTitle,
  //           claimsRegistrationDossierClass: res.claimsRegistrationDossierClass,
  //           amountRequested: res.amountRequested,
  //           litigationFee: res.litigationFee,
  //           unitTypeId: res.unitTypeId,
  //           dossierExpertTitle: res.dossierExpertTitle,
  //           contractPersianDate: res.contractPersianDate,
  //           dateTitle: res.dateTitle,
  //           executiveIssuancePersianDate: res.executiveIssuancePersianDate,
  //           orderExecutionPersianDate: res.orderExecutionPersianDate,
  //           unitName: res.unitName,
  //           solarPrintDate: res.solarPrintDate,
  //           userCode: res.userCode,
  //           userNameTitle: userNameTitle,
  //           unitTypeTitle: res.unitTypeTitle,
  //         });
  //       },
  //       (error) => HandleError(Helpers, this.notificationSystem, error),
  //       () => this.setState({ isLoading: false })
  //     );
  //   };

  render() {
    return (
      <>
        <Card
          title={""}
          icon={this.pageInfo.icon}
          footerLinks={[{ href: "/", text: "صفحه اصلی" }]}
          topButtons={[
            //     {
            //       title: "اطلاعات مشتریان حقیقی",
            //       icon: "list",
            //       color: " text-white bg-primary fw-bolder rounded ",
            //       url: () => this.printDocumetn(),
            //     },
            {
              // title: "بازگشت به  صفحه اصلی",
              // url: "/",
              // color: "outline-primary",
              // icon: "ti ti-arrow-left",
            },
          ]}
        >
          <div className="row">
            <div className=" col-lg-4 ">
              <img className="header-middle-img" src={logo} />
            </div>
            <div className="header2 col col-lg-4">
              <h2>اطلاعات مشتریان حقیقیCIF</h2>
              <h4>(مخصوص اشخاص حقیقی)</h4>

              <p>
                شعبه:............. شاخص شعبه:............. تاریخ:..............
              </p>
            </div>
            <div className=" col-lg-4 ">
              <p>شماره مشتری:..........</p>
            </div>
          </div>
          <Delimiter />
          {/*  <hr className="hr"></hr>
            <div className="body">
              <div>
                <table className="table1">
                  <tbody>
                    <tr>
                      <td className="td1 ">
                        شماره پرونده دعاوی :&nbsp;
                        <span>{this.state.generatedCode} </span>
                      </td>
                      <td className="td1 ">
                        نوع پرونده :<span> {this.state.dossierTypeTitle}</span>
                      </td>
                    </tr>
                    <tr>
                      <td className="td ">
                        خواهان/شاکی :<span> {this.state.plaintiff} </span>
                      </td>
                      <td className="td ">
                        مالی/غیرمالی :
                        <span> {this.state.financialOrNonfinancialTitle} </span>
                      </td>
                    </tr>
                    <tr>
                      <td className="td1 ">
                        خوانده/متشکی عنه :<span> {this.state.complainted}</span>
                      </td>
                      <td className="td1 ">
                        وضعیت دعوی :
                        <span> {this.state.lawsuitStatusTitle} </span>
                      </td>
                    </tr>
                    <tr>
                      <td className="td ">
                        طرف دعوی :<span> {this.state.litigantTitle} </span>
                      </td>
                      <td className="td ">
                        موضوع دعوی :<span> {this.state.topicsTypeTitle} </span>
                      </td>
                    </tr>
                    <tr>
                      <td className="td1 ">
                        تاریخ ایجاد پرونده :
                        <span> {this.state.dossierFilingPersianDate} </span>
                      </td>

                      <td className="td1 ">
                        کلاسه دادگاه :
                        <span>
                          {" "}
                          {this.state.claimsRegistrationDossierClass}{" "}
                        </span>
                      </td>
                    </tr>
                    <tr>
                      <td className="td ">
                        تاریخ دادخواست :<span> {this.state.dateTitle} </span>
                      </td>
                      <td className="td ">
                        مبلغ خواسته/معادل ریالی : &nbsp;
                        <span>
                          {typeof this.state.amountRequested === "number"
                            ? this.state.amountRequested.toLocaleString()
                            : this.state.amountRequested}
                        </span>
                      </td>
                    </tr>
                    <tr>
                      <td className="td1 ">
                        تاریخ صدور اجرائیه :
                        <span> {this.state.executiveIssuancePersianDate} </span>
                      </td>
                      <td className="td1 ">
                        هزینه های دادرسی :&nbsp;
                        <span>
                          {typeof this.state.litigationFee === "number"
                            ? this.state.litigationFee.toLocaleString()
                            : this.state.litigationFee}
                        </span>
                      </td>
                    </tr>
                    <tr>
                      <td className="td ">
                        تاریخ اجرای حکم :
                        <span> {this.state.orderExecutionPersianDate} </span>
                      </td>
                      <td className="td ">
                        نوع واحد : <span>{this.state.unitTypeTitle} </span>
                      </td>
                    </tr>
                    <tr>
                      <td className="td1 ">
                        تاریخ اختتام پرونده :
                        <span>{this.state.dossierClosingPersianDate} </span>
                      </td>
                      <td className="td1 ">
                        واحد ارسال کننده :<span> {this.state.unitName} </span>
                      </td>
                    </tr>
                    <tr>
                      <td colSpan="2" className="td">
                        ملاحظات :<span> {this.state.description} </span>
                      </td>
                    </tr>
                  </tbody>
                </table>
              </div>
            </div>
            <hr className="hr"></hr>
            <h3>کارشناسان</h3>

            <div>
              <SimpleGrid
                hideExportButton={true}
                hideRefreshButton={true}
                hidePrintButton={true}
                context={this}
                dataKey="id"
                minHeightTableWrapper={constants.MinGridHeight}
                filterBgColor="primary"
                name="grid"
                title="فهرست کارشناسان"
                listApiUrl="/api/eld/expert/getList"
                enableAutoFetch={true}
                notificationSystem={this.notificationSystem}
                extraItemsSentToFetchData={this.state.extraData}
                headers={[
                  { title: "نام کارشناس", name: "expertPersonNameCode" },
                  { title: "تاریخ شروع", name: "shamsiStartDate" },
                  { title: "تاریخ اتمام", name: "shamsiEndDate" },
                  {
                    title: "کارشناس فعلی",
                    name: "isCurrentExportTitle",
                    style: (e) => this.checkStatus(e),
                  },
                ]}
              />
            </div>
            <hr></hr>
            <h3>اقدامات انجام شده روی پرونده</h3>

            <div>
              <SimpleGrid
                hideExportButton={true}
                hideRefreshButton={true}
                hidePrintButton={true}
                context={this}
                dataKey="id"
                minHeightTableWrapper={constants.MinGridHeight}
                filterBgColor="primary"
                name="grid"
                title="فهرست اقدامات انجام شده"
                listApiUrl="/api/eld/doingOnActionDossier/getList"
                extraItemsSentToFetchData={this.state.extraData}
                notificationSystem={this.notificationSystem}
                enableAutoFetch={true}
                headers={[
                  { title: "تاریخ اقدام", name: "shamsiActionDate" },
                  { title: "اقدام انجام شده", name: "actionTypeTitle" },
                  { title: "ملاحظات", name: "description" },
                ]}
              />*/}
        </Card>
      </>
    );
  }
}

export default RealCustomerInformationSection;
